import utra_logo from "./logos/UTRA_logo_square.png";
import toronto_skyline from "./Home Page Photos/torontoSkyline2.png";
import './Home.css';

function Home() {
  return (
    <div className = "bg text-center mt-4">   
      <h1 className="text">Welcome to UTRA Hacks!</h1>
      <img src= {toronto_skyline} alt = "Toronto Syline"/>
    </div> 
  );
}

export default Home;
